package com.weizz5.code.leetCode;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

/**
 * 给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的字母异位词。
 *
 * 示例 1:
 *
 * 输入: s = "anagram", t = "nagaram"
 * 输出: true
 * 示例 2:
 *
 * 输入: s = "rat", t = "car"
 * 输出: false
 *
 * @author weizz5
 * @date 2020/04/05
 */
public class IsAnagram {

    public static void main(String[] args) {
        IsAnagram isAnagram = new IsAnagram();

        String s ="";
        String t = "";
        long time = System.currentTimeMillis();
        System.out.println(isAnagram.isAnagram(s,t)+", 耗时："+(System.currentTimeMillis()-time));

        System.out.println(isAnagram.isAnagram("rat","car"));
    }

    public boolean isAnagram(String s, String t) {

        return isAnagram2(s,t);
//        System.out.println(similar);

    }

    public boolean isAnagram2(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        int[] counter = new int[26];
        for (int i = 0; i < s.length(); i++) {
            counter[s.charAt(i) - 'a']++;
            counter[t.charAt(i) - 'a']--;
        }
        for (int count : counter) {
            if (count != 0) {
                return false;
            }
        }
        return true;
    }
    public boolean isAnagramMyself(String s, String t) {
        if(null==s ||null == t ||s.length() != t.length() ){
            return false;
        }
        char[] sCharArray = s.toCharArray();
        char[] tCharArray = t.toCharArray();
        List<Integer> index = new ArrayList<>();
        for(int i=0; i<sCharArray.length; i++){
            char sChar = sCharArray[i];
            boolean hasChar = false;

            for(int j=0; j<tCharArray.length; j++){
                char tChar = tCharArray[j];
                if(sChar==tChar && !index.contains(j)){
                    hasChar = true;
                    index.add(j);
                    break;
                }
            }

            if(!hasChar){
                return false;
            }
        }

        return true;
    }

    public boolean isAnagram1(String s, String t) {
        if(null==s ||null == t ||s.length() != t.length() ){
            return false;
        }
        char[] sCharArray = s.toCharArray();
        char[] tCharArray = t.toCharArray();
        Arrays.sort(sCharArray);
        Arrays.sort(tCharArray);


        return Arrays.equals(sCharArray,tCharArray);
    }


    /**
     * 字符串匹配相似度
     *
     * @param source 源
     * @param target 要匹配的字符串
     * @return
     */
    public static double getSimilarity(String source, String target) {
        char[] sources = source.toCharArray();
        char[] targets = target.toCharArray();
        int sourceLen = sources.length;
        int targetLen = targets.length;
        int[][] d = new int[sourceLen + 1][targetLen + 1];
        for (int i = 0; i <= sourceLen; i++) {// 列
            d[i][0] = i;
        }
        for (int i = 0; i <= targetLen; i++) {// 行
            d[0][i] = i;
        }

        for (int i = 1; i <= sourceLen; i++) {
            for (int j = 1; j <= targetLen; j++) {
                if (sources[i - 1] == targets[j - 1]) {
                    d[i][j] = d[i - 1][j - 1];
                } else {
                    //插入
                    int insert = d[i][j - 1] + 1;
                    //删除
                    int delete = d[i - 1][j] + 1;
                    //替换
                    int replace = d[i - 1][j - 1] + 1;
                    d[i][j] = Math.min(insert, delete) > Math.min(delete, replace) ? Math.min(delete, replace) : Math.min(insert, delete);
                }
            }
        }
        double result = 1 - (double) d[sourceLen][targetLen] / Math.max(source.length(), target.length());
        return result;
//        return d[sourceLen][targetLen];
    }
}
